 const [favoritePosts, setFavoritePosts]=useState([]);
 const dispatch=useDispatch()
useEffect(() => {
 dispatchEvent()
}, [userId]);

  return (
    <div>
     
        <h1>Favorite Posts</h1>
        <section>
          {favoritePosts.length > 0 ? (
            <div>
              {favoritePosts.map((post) => (
                <PostItem key={post._id} post={post} />
              ))}
            </div>
          ) : (
            <h2> no  favorites memories</h2>
          )}
        </section>
      
    </div>
  );
}

